import React from 'react';

const UserList = () =>{
    const users = [
        {
            id:"01",
            nombre:"Nombre1",
            apellido:"apellido1",
            comuna:"comuna1",
            password:"secret"

        },
        {
            id:"02",
            nombre:"Nombre2",
            apellido:"apellido2",
            comuna:"comuna2",
            password:"secret2"

        }
    ]

    return(
        <div>
            users.array.forEach(user => {
                <div>
                    <div>
                        {user.id}
                    </div>
                    <div>
                        {user.nombre}{user.apellido}
                    </div>
                </div>
            });

        </div>
    )
}

export default UserList;
